public class Day2 {
    public static int solve() {
        String[] arr2 = getInput().split("\n");
        int[][] arr = {{1, 2, 3}, {4, 5, 6}, {7, 8, 9}};
        int index1 = 1;
        int index2 = 1;
        String result = "";
        for (String a : arr2) {
            for (char b : a.toCharArray()) {
                switch (b) {
                    case 'U': {
                        index1 -= (index1 != 0) ? 1 : 0;
                        break;
                    }
                    case 'R': {
                        index2 += (index2 != 2) ? 1 : 0;
                        break;
                    }
                    case 'D': {
                        index1 += (index1 != 2) ? 1 : 0;
                        break;
                    }
                    case 'L': {
                        index2 -= (index2 != 0) ? 1 : 0;
                        break;
                    }
                }
            }
            result += arr[index1][index2];
        }
        return Integer.parseInt(result);
    }

    private static String getInput() {
        return "\n" +
                "\n" +
                "\n" +
                "\n" +
                "";
    }
}
